description:
House Broken (2009)  

Verenigde Staten
Komedie
84 minuten

geregisseerd door Sam Harper
met Danny DeVito, Skyler Stone en Caitlin Crosby

Om samen met zijn vrouw van zijn pensioen te genieten, besluit Cathkart (DeVito) zijn zoons van in de twintig uit huis te krijgen. Het lukt hem maar niet om zijn zoons zover te krijgen dat ze op zichzelf gaan wonen. Maar hij gaat door, koste wat het kost...


